import React, { useState } from 'react';
import { Container, Form, Button } from 'react-bootstrap';
import PostCard from '../components/PostCard';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const AccountPage = () => {
  const [userFirstName, setUserFirstName] = useState('');
  const [userLastName, setUserLastName] = useState('');
  const [userPassword, setUserPassword] = useState('');
  const [userEmail, setUserEmail] = useState('');
  const [userPhone, setUserPhone] = useState('');

  const handleFormSubmit = (e) => {
    e.preventDefault();
    // Perform form submission logic here
  }

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 3,
    slidesToScroll: 1,
    prevArrow: <CustomPrevArrow />, // Custom component for previous arrow
    nextArrow: <CustomNextArrow />
  };

  const CustomPrevArrow = (props) => {
    const { onClick } = props;
    return (
      <button className="prev-arrow" onClick={onClick}>
        {/* Add your custom previous arrow content here */}
        <span>Previous</span>
      </button>
    );
  };
  
  // Custom next arrow component
  const CustomNextArrow = (props) => {
    const { onClick } = props;
    return (
      <button className="next-arrow" onClick={onClick}>
        {/* Add your custom next arrow content here */}
        <span>Next</span>
      </button>
    );
  };

  return (
    
    <Container style={{marginTop: '64px'}}>
      <h1>Personal Account</h1>
      <Slider {...settings}>
      <div>
        <h3>Slide 1</h3>
      </div>
      <div>
        <h3>Slide 2</h3>
      </div>
      <div>
        <h3>Slide 3</h3>
      </div>
      <div>
        <h3>Slide 4</h3>
      </div>
      <div>
        <h3>Slide 5</h3>
      </div>
      <div>
        <h3>Slide 6</h3>
      </div>
    </Slider>
      <Form onSubmit={handleFormSubmit}>
      <br />
        <Form.Group controlId="userFirstName">
          <Form.Label>First Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your first name"
            value={userFirstName}
            onChange={(e) => setUserFirstName(e.target.value)}
          />
        </Form.Group>
        <br />
        <Form.Group controlId="userLastName">
          <Form.Label>Last Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your last name"
            value={userLastName}
            onChange={(e) => setUserLastName(e.target.value)}
          />
        </Form.Group>
        <br />
        <Form.Group controlId="userPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Enter your password"
            value={userPassword}
            onChange={(e) => setUserPassword(e.target.value)}
          />
        </Form.Group>
        <br />
        <Form.Group controlId="userEmail">
          <Form.Label>Email</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter your email"
            value={userEmail}
            onChange={(e) => setUserEmail(e.target.value)}
          />
        </Form.Group>
        <br />
        <Form.Group controlId="userPhone">
          <Form.Label>Phone</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your phone number"
            value={userPhone}
            onChange={(e) => setUserPhone(e.target.value)}
          />
        </Form.Group>
        <br />
        <br />
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </Container>
  );
}

export default AccountPage;
